lens_4.query:
q = load "Load_opty_services_acct_all";
{{cell(OptyRoleToggle_1.selection, 0, "saql_filter").asString()}}"{{cell(UserData.selection, 0, "Id").asString()}}";
q = filter q by 'OpportunityServices__c.StageName' == "Closed Won";
q = filter q by 'Days_to_Close__c' != 0;
q = group q by ('OpportunityServices__c.gCRM_Opportunity_ID__c');
q = foreach q generate first(q.'Days_to_Close__c') as 'Days_to_Close__c',('OpportunityServices__c.gCRM_Opportunity_ID__c') as 'C';
q = group q by all;
q = foreach q generate sum('Days_to_Close__c') as 'Days_to_Close__c', unique('C') as 'C';
q = foreach q generate round(coalesce((coalesce('Days_to_Close__c', 0)/coalesce('C', 0)), 0)) as 'Avg Days to Close';
